'clinic profile':function(browser){
	browser
	 .useCss()
	 .pause(500)
	 .click('i[class="fa fa-hospital-o fa-fw"]')
	 .click('a[href="/EHR/Clinicadmin/clinicadmin-profile"]')
	 .waitForElementVisible('button[onclick="changeUsername()"]' , 60000)
	 .pause(500)
	 .getValue('#clinicname_id' , function(result){
	 	clinic_name.push(result.value)
	 })
	 .getValue('#physicianname_id' , function(result){
         doctor.push(result.value)
	 })
	 .getValue('#address_id' , function(result){
	 	  address.push(result.value)
	 })
	 .getValue('#city_id' , function(result){
	 	  city.push(result.value)
	 })
	 .getAttribute('#state_id' , 'data-state' , function(result){
	 	  state.push(result.value)
	 })
	 .getValue('#zipcode_id' , function(result){
	 	zip.push(result.value)
	 })
	 .getValue('#clinicphone_id' , function(result){
	 	phone.push(result.value)
	 })
	 .getValue('#emailid_id' , function(result){
	 	email.push(result.value)
	 })

},
'open patient' : function(browser){
    browser
       .useCss()
       .pause(500)
       .click('a[class="firstLevel"]')
       .click('a[href="/EHR/Clinicadmin/view-patient-details-open"]')   
       .waitForElementVisible('a[class="btn btn-changecolor tooltipsclass"]' , 60000)
       .pause(500)
       .useXpath()
       .click("//*[@id='patient']/tbody/tr/td[6]/a/i")
       .useCss()
       .waitForElementVisible('#patient_first_name' , 60000)
       .pause(500)
    .useCss()
    .getAttribute('#date_of_birth' , 'value' , function(result){
          var birthdate = new Date(result.value);
          var cur = new Date();
          var diff = cur-birthdate; // This is the difference in milliseconds
          age = Math.floor(diff/31536000000); // Divide by 1000*60*60*24*365
         
    })
},
